<?
class Base64
{
    
    private $icones = Array(
            "headphone" => "",
            
            "headphone-branco" => "",
            
          "play" => "",  
          
          "pause" => "",
          
          "mute" => "",
          
          "loading" => "",
          
          "loading-branco" => "",
          
          "volume-branco" => "",
          
          "play-branco" => "",
          
          "pause-branco" => "",
    );
    
    /**
    * @param string $nome Nome do Icone contido na base
    */
    function icone($nome, $gif=false){
        if($gif==true)
            return "data:image/gif;base64,".$this->icones[$nome];
        else
            return "data:image/png;base64,".$this->icones[$nome];
    }
}